import { decompress } from './decompress.mjs';

function buildFromTuples(
  keys          ,
  lookups          ,
  tupleList            ,
) {
  const list                                    = [];
  for (const tuple of tupleList) {
    const data                                  = {};
    for (let i = 0; i < tuple.length; i++) {
      data[keys[i]] = tuple[i];
      if (keys[i] === "ThemeGroup") {
        data.ThemeGroup = lookups[tuple[i]];
      }
      if (keys[i] === "Theme") {
        data.Theme = lookups[tuple[i]];
      }
      if (keys[i] === "Subtheme") {
        data.Subtheme = lookups[tuple[i]];
      }
    }
    list.push(data);
  }
  return list;
}  
const keys = ["YearFrom","Theme","ThemeGroup","Subtheme","SetName","ImageFilename","USRetailPrice","USDateAdded","USDateRemoved","BrickLinkSoldPriceNew","BrickLinkSoldPriceUsed","LaunchDate","ExitDate","ItemNumber"];
const compressedLookups = "";
const compressedData = "";

// Convert base64 back to Uint8Array
function base64ToUint8Array(base64) {
  const binary = atob(base64);
  const bytes = new Uint8Array(binary.length);
  for (let i = 0; i < binary.length; i++) {
    bytes[i] = binary.charCodeAt(i);
  }
  return bytes;
}

// Decompress and parse the data
async function loadData() {
  const uint8Data = base64ToUint8Array(compressedData);
  const uint8Lookups = base64ToUint8Array(compressedLookups);
  const decompressedString = await decompress(uint8Data);
  const decompressedLookups = await decompress(uint8Lookups);
  const tupleList = JSON.parse(decompressedString);
  const lookups = JSON.parse(decompressedLookups);
  return buildFromTuples(keys, lookups, tupleList);
}

export default loadData;